import React, { useState, useEffect } from 'react';
import api from '../services/api';
import { useNavigate } from 'react-router-dom';

const AllSubscriptions = () => {
  const [subscriptions, setSubscriptions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchSubscriptions = async () => {
      try {
        setLoading(true);
        console.log("Fetching all subscriptions...");

        // Make sure token is in headers
        const token = localStorage.getItem('token');
        if (!token) {
          console.error("No token found");
          setError("You need to log in first");
          navigate('/login');
          return;
        }

        // Ensure the Authorization header is set properly
        api.defaults.headers.common['Authorization'] = `Bearer ${token}`;

        const response = await api.get('/subscriptions/all');
        console.log("Subscriptions fetched:", response.data);
        setSubscriptions(response.data);
        setError('');
      } catch (err) {
        console.error("Error fetching subscriptions:", err);
        let errorMsg = "Failed to fetch subscriptions";

        if (err.response) {
          // Add more detailed error message
          errorMsg += ": " + (err.response.data?.message || err.message);

          // If unauthorized, redirect to login
          if (err.response.status === 401) {
            localStorage.removeItem('token');
            navigate('/login');
          }
        } else {
          errorMsg += ": " + err.message;
        }

        setError(errorMsg);
      } finally {
        setLoading(false);
      }
    };

    fetchSubscriptions();
  }, [navigate]);

  if (loading) return <div className="loading">Loading subscriptions...</div>;

  return (
    <div className="all-subscriptions">
      <h2>All Subscriptions</h2>

      {error ? (
        <div className="error-message">
          <p>{error}</p>
          <p>Please make sure you have admin privileges and are properly logged in.</p>
          <button 
            className="submit-btn" 
            onClick={() => {
              localStorage.removeItem('token');
              navigate('/login');
            }}
            style={{marginTop: '10px', maxWidth: '200px'}}
          >
            Log out and try again
          </button>
        </div>
      ) : subscriptions.length === 0 ? (
        <div className="no-data">
          <p>No subscriptions found.</p>
        </div>
      ) : (
        <table className="subscriptions-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>User</th>
              <th>Plan</th>
              <th>Start Date</th>
              <th>End Date</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {subscriptions.map((subscription) => (
              <tr key={subscription.id}>
                <td>{subscription.id}</td>
                <td>{subscription.username}</td>
                <td>{subscription.plan_name}</td>
                <td>{new Date(subscription.start_date).toLocaleDateString()}</td>
                <td>{new Date(subscription.end_date).toLocaleDateString()}</td>
                <td className={subscription.is_active ? 'active' : 'inactive'}>
                  {subscription.is_active ? 'Active' : 'Inactive'}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default AllSubscriptions;
